bh.TSV["901337848"] = "name\talt\teffectType\tdescription\tvalue\nAccuracy Down\t\tStatus\tThe target's accuracy will be lowered by 20%.\t\nAccuracy Up\t\tStatus\tThe target's accuracy will be increased by 20%.\t\nAttack Down\t\tStatus\tThe attack of the target will be decreased by a percentage.\t\nAttack Up\t\tStatus\tThe attack of the target will be increased by a percentage.\t\nAwaken\t\tStatus\tAwakens a Sleeping Hero.\t\nBackstab\t\tStatus\tAn UNAWARE target suffers double damage from the attack. Unaware targets are targets under the following status effects: CONFUSE, SLEEP, STUN, BAMBOOZLE\t\nBamboozle\t\tStatus\tHas a chance to target the wrong enemy with a small chance to miss completely.\t\nBleed\t\tStatus\tDeals an increasing 60% of the cards damage over turns.\t\nBurn\t\tStatus\tDeals a decreasing 60% of the cards damage over turns.\t\nCharm\t\tStatus\tThe caster will Taunt and leave the enemies with Attack Down.\t\nChill\t\tStatus\tThe target will be slowed by +1 Turn.\t\nConfuse\t\tStatus\tThe targets accuracy will be lowered by 20%.\t\nCounter\t\tStatus\tIf attacked, the target will deal counter damage.\t\nCritical\t\tStatus\tAdds an additional 50% to the cards value.\t\nCrush\tShield Break\tStaus\tThe attack will deal double damage to Shields.\t\nCure All\t\tStatus\tCures ALL the following status effects: Posion, Shock, Confuse, Chill, Burn, Bleed\t\nCure Burn\t\tStatus\tCures Burn status effects.\t\nCure Chill\t\tStatus\tCures Chill status effects.\t\nCure Confuse\t\tStatus\tCures Spirit status effects.\t\nCure Poison\t\tStatus\tCures Earth status effects.\t\nCure Shock\t\tStatus\tCures Air status effects.\t\nDefence Down\t\tStatus\tThe defence of the target will be decreased by a percentage.\t\nDefence Up\t\tStatus\tThe defence of the target will be increased by a percentage.\t\nDrown\t\tStatus\tDeals an extra 100% of the cards damage after N turns.\t\nEvade\t\tStatus\tThe target has a 50% chance to evade incoming attacks.\t\nExtend Bleed\t\tStatus\tOn a target bleeding for X damage over Y turns, it will add another X bleed damage over Y turns.\t\nExtend Burn\t\tStatus\tOn a target burning for X damage over Y turns, it will add another X burn damage over Y turns.\t\nExtend Poison\t\tStatus\tOn a target poisoned for X damage over Y turns, it will add another X poison damage over Y turns.\t\nExtend Shock\t\tStatus\tOn a target shocked for X damage over Y turns, it will add another X shock damage over Y turns.\t\nFlurry\t\tStatus\tCasts multiple attacks at the target, each with a chance to miss.\t\nHaste\t\tStatus\tThe target will be sped up by +1 Turn.\t\nImmunity to Bleed\tImmune To Bleed\tStatus\tImmune to Bleed effect for N turns\t\nImmunity to Burn\tImmune To Burn\tStatus\tImmune to Burn effect for N turns.\t\nImmunity to Charm\tImmune To Charm\tStatus\tImmune to Charm effect for N turns\t\nImmunity to Chill\tImmune To Chill\tStatus\tImmune to Chill effect for N turns.\t\nImmunity to Confuse\tImmune To Confuse\tStatus\tImmune to Confuse effect for N turns.\t\nImmunity to Poison\tImmune To Poison\tStatus\tImmune to Poison effect for N turns.\t\nImmunity to Shock\tImmune To Shock\tStatus\tImmune to Shock effect for N turns.\t\nImmunity to Stun\tImmune To Stun\tStatus\tImmune to Stun effect for N turns.\t\nInterrupt\t\tStatus\tInterrupts the target's charge by +1 Turn up to their initial charge value.\t\nLeech\t\tStatus\tLeeches 100% of the cards damage immediately.\t\nLuck Down\t\tStatus\tPrevents cards to be perked for N turns.\t\nLuck Up\t\tStatus\tCards are always perked for N turns.\t\nMarked\tMark\tStatus\tThe target suffers double damage while marked.\t\nMax Health Down\t\tStatus\tThe attack of the target will be increased by a percentage.\t\nMax Health Up\tMax HP Up\tStatus\tThe max health of the target will be increased by a percentage.\t\nMulti-Target (Ally)\t\tTargeting\tThe defence will heal / shield all allied target(s).\t\nMulti-Target (Enemy)\t\tTargeting\tThe attack will deal damage to all enemy target(s).\t\nPerfect Shot\t\tStatus\tThe attack will ignore any Accuracy / Agility modifiers.\t\nPierce\tShield Pierce\tStatus\tThe attack will go through shields and deal health damage to the target.\t\nPoison\t\tStatus\tDeals a flat 60% of the cards damage over turns.\t\nRandom Target\t\tTargeting\tThe attack will pick an enemy at random if there is more than one target.\t\nRecoil\t\tStatus\tThe attacker will take some self damage when attacking the target.\t\nRegen\t\tStatus\tRegenerates health over several turns.\t\nRegen Break\t\tStatus\tEnds health regeneration.\t\nReset\t\tStatus\tFully resets the targets charge back to its initial charge value.\t\nSap\t\tStatus\tLeeches 100% of the cards damage over several turns.\t\nSelf\t\tTargeting\tTargets self only.\t\nShield Bind\t\tStatus\tAdds 50% of the current shield value to the damage.\t\nShock\t\tStatus\tDeals a flat 60% of the cards damage over turns.\t\nSingle\t\tTargeting\tTargets a single target only.\t\nSleep\t\tStatus\tSends the target to sleep, but will be awoken if attacked.\t\nSlow\t\tStatus\tThe target will be slowed by +1 Turn.\t\nSplash Damage\tSplash\tTargeting\t100% damage dealt to the target, with 50% to any adjacent target(s).\t\nStun\t\tStatus\tThe target's accuracy will be lowered by 20%.\t\nTaunt\t\tStatus\tAll enemies will only attack the Taunting target.\t\nDrain Trait\tTrait Down\tStatus\tDischarge target’s Trait\t\nTrait Up\t\tStatus\tCharge target’s Trait\t\nWarp\tWarped\tStatus\tThe targets cards will speed up and / or slow down.\t\nStorm\tWeaken to Air\tStatus\tWeakens the target to Air by 50%.\t\nTerra\tWeaken to Earth\tStatus\tWeakens the target to Earth by 50%.\t\nOil\tWeaken to Fire\tStatus\tWeakens the target to Fire by 50%.\t\nDarken\tWeaken to Spirit\tStatus\tWeakens the target to Spirit by 50%.\t\nWet\tWeaken to Water\tStatus\tWeakens the target to Water by 50%\t";
